function Dashboard() {
  return (
    <div>
      <h1 style={{ marginBottom: "20px" }}>Welcome ðŸ‘‹</h1>

      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(200px, 1fr))",
          gap: "20px",
        }}
      >
        <Card title="Users" value="120" />
        <Card title="Products" value="45" />
        <Card title="Orders" value="89" />
        <Card title="Revenue" value="$12,300" />
      </div>
    </div>
  );
}

function Card({ title, value }) {
  return (
    <div
      style={{
        background: "#fff",
        padding: "20px",
        borderRadius: "10px",
        boxShadow: "0 4px 10px rgba(0,0,0,0.05)",
      }}
    >
      <h3 style={{ marginBottom: "10px", color: "#6b7280" }}>{title}</h3>
      <h2>{value}</h2>
    </div>
  );
}

export default Dashboard;
